import {useState} from 'react'
import  './style.css'
function MyNewP(){

 const [time, setTime] = useState(0);

    function add(){
      //  Date.now()
      const res = Date.now();
      setTime(res);
    }

    return(
        <div>

<button className='Spotify' onClick={add} >click {time}</button>


        </div>
    )
}
export default MyNewP;
